import React from 'react';
import { Container, Typography, Box } from '@mui/material';
import { styled } from '@mui/system';

const BackgroundContainer = styled(Box)(({ theme }) => ({
  backgroundImage: 'url(/images/travel-home.jpg)',
  backgroundSize: 'cover',
  backgroundPosition: 'center',
  minHeight: '100vh',
  display: 'flex',
  justifyContent: 'center',
  alignItems: 'center',
  textAlign: 'center',
  color: 'white',
  padding: '0 2rem',
}));

const HomeContent = styled('div')({
  backgroundColor: 'rgba(0, 0, 0, 0.5)', // Optional: Dark overlay for better text visibility
  padding: '2rem',
  borderRadius: '10px',
});

const Home = () => {
  return (
    <BackgroundContainer>
      <HomeContent>
        <Typography variant="h2" gutterBottom>
          Welcome to the Travel Exchange Platform
        </Typography>
        <Typography variant="h6">
          Share your travel experiences, find travel buddies, and explore new destinations.
        </Typography>
      </HomeContent>
    </BackgroundContainer>
  );
};

export default Home;
